import React from 'react'
import { styles } from '../styles';

const DateFormater =(props) => {
    let date = props.date;
    date = date.split(" ")
    const year = date[0]
    const day = date[0]
    const month = date[1]

    return (
        day, month, year
    )
}

export const NavBar = (props) => {
    const year = props.date.toString()


  return (
    <div style={styles.Container}>
        <text>{year}</text>
        <a>Home</a>
        <a>Resume</a>
        <a>Personal Interests</a>
        <div>
            <a>LinkedIn</a>
            <a>GitHub</a>
        </div>
    </div>

  );
};
